SET NAMES 'utf8';
DROP DATABASE IF EXISTS bishe;
CREATE DATABASE bishe CHARSET=UTF8;
USE bishe;

--创建用户表
CREATE TABLE information(
    uid INT PRIMARY KEY AUTO_INCREMENT,
    username VARCHAR(64),
    password VARCHAR(64),
    gender CHAR(10),
    qq VARCHAR (64),
    email VARCHAR (64),
    type VARCHAR (100),
    binarydata mediumblob,
    chkcode VARCHAR (64)
);
