--创建文本表
--filename 文件保存的文件夹名
--rank 文件手动排序的位置
--uploadtime 文件上传时候记录的时间,创建时间

--txtid对应uid和aid=$_session['all']['uid']
CREATE TABLE text(
tid INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
uername VARCHAR (80) NOT NULL,
filename VARCHAR (10000),
rank INT ,
uploadtime LONG,
edittime long,
txtid INT,
name VARCHAR(80) NOT NULL ,
type VARCHAR(100) NOT NULL ,
size INTEGER NOT NULL ,
content MEDIUMBLOB #MAX=50MB
  )ENGINE=InnoDB DEFAULT CHARSET=utf8;

