--创建文本标记表
-- mid 标注的id
-- name 文本名
-- method 标注方法1.手动 2.半自动 3.自动
-- describe 文件描述
-- mark_time 标注时间
-- mcontent 标注内容
-- mlocation 标注内容的位置
-- msize 标注内容大小
-- front 标注前内容
-- behind 标注后内容

CREATE TABLE mark(
mid INT PRIMARY KEY AUTO_INCREMENT NOT NULL,
name VARCHAR(80) NOT NULL ,
method INT NOT NULL,
description VARCHAR(1024) NOT NULL,
mark_time VARCHAR (2048),
comment MEDIUMBLOB ,
color VARCHAR (80),
mlocation INT ,
msize INTEGER ,
front MEDIUMBLOB,
behind MEDIUMBLOB
  )ENGINE=InnoDB DEFAULT CHARSET=utf8;

